import { Box, Link, Paper, Typography } from "@mui/material";

import AppLogo from "./AppLogo";
import PropTypes from "prop-types";
import React from "react";

// SideAppbar component for app which displays logo, list of items and app version
function SideAppbar({ logoLinkUrl = null, showLogo = true, onButtonClick }) {
  // use theme

  // VIRTO app list
  const appList = [
    {
      icon: "data:image/svg+xml;base64,",
      name: "VIRTO.BUILD"
    },
    {
      icon: "data:image/svg+xml;base64,",
      name: "VIRTO.FLEET"
    },
    {
      icon: "data:image/svg+xml;base64,",
      name: "VIRTO.MODEL"
    },
    {
      icon: "data:image/svg+xml;base64,",
      name: "VIRTO.SCENE"
    },
    {
      icon: "data:image/svg+xml;base64,",
      name: "VIRTO.TEST"
    },
    {
      icon: "data:image/svg+xml;base64,",
      name: "VIRTO.RESULT"
    },
    {
      icon: "data:image/svg+xml;base64,",
      name: "VIRTO.DATA"
    },
    {
      icon: "data:image/svg+xml;base64,",
      name: "VIRTO.VEHICLE"
    },
    {
      icon: "data:image/svg+xml;base64,",
      name: "VIRTO.ID"
    }
  ];

  // handle button click
  const handleClick = name => {
    onButtonClick(name);
  };

  return (
    <>
      {showLogo ? (
        <>
          {logoLinkUrl ? (
            <Link href={logoLinkUrl} underline="none">
              <AppLogo />
            </Link>
          ) : (
            <AppLogo />
          )}
        </>
      ) : null}
      <Box display="flex" flexWrap="wrap" justifyContent="space-between">
        {appList.map(app => {
          return (
            <Paper
              key={app.name}
              data-testid={app.name}
              sx={theme => ({
                "&:hover": {
                  boxShadow: theme.shadows[1]
                },
                boxShadow: "none",
                cursor: "pointer",
                mb: 2,
                width: 120
              })}
              onClick={() => handleClick(app.name)}
            >
              <Box sx={{ px: 2, py: 1.5, textAlign: "center" }}>
                <Box
                  component={"img"}
                  alt={app.name}
                  src={app.icon}
                  sx={{ height: 60, mb: 1, width: 60 }}
                />
                <Typography color="textPrimary" variant="subtitle2">
                  {app.name}
                </Typography>
              </Box>
            </Paper>
          );
        })}
      </Box>
      <Box flexGrow={1} />
    </>
  );
}

SideAppbar.propTypes = {
  /**
   * A String of the href URL for the Link of the IPG Logo, default is null (link disabled)
   */
  logoLinkUrl: PropTypes.string,
  /**
   * Callback fired when the file is changed.
   *
   * **Signature**
   * ```
   * function(name: string) => void
   * ```
   *
   * _name_: The name of the clicked app
   * @default () => {}
   * @type {function}
   */
  onButtonClick: PropTypes.func,
  /**
   * Boolean to determine if logo should be displayed at the top of the SideAppbar
   */
  showLogo: PropTypes.bool
};

export default SideAppbar;
